import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  let expenses = props.expenses.map((item, index) => {
    console.log(item);
    return (
      <ExpenseItem
        key={index}
        title={item.title}
        amount={item.amount}
        date={item.date}
      ></ExpenseItem>
    );
  });

  return { expenses };
}

export default Expenses;
